
-- Contact Us Waukesha Edits

---- Get our salesrepgroup_id

DECLARE @WaukeshaGroupID int
SELECT @WaukeshaGroupID = id FROM salesrepgroup WHERE label = 'Waukesha'

---- Get our salesrep group ids

DECLARE @BradH int
DECLARE @LisaT int

INSERT INTO salesrep
	(person, phone, email)
VALUES
	('Lisa Tran', '(414) 698-6436', 'lisa.tran@gen-probe.com')
	
SET @BradH = 30
SET @LisaT = @@IDENTITY

